script: |
  super -f text -I q9388.spq | sort > q9388.out

inputs:
  - name: q9388.spq
    data: |
      SELECT DISTINCT - - ( col2 ) AS col1 FROM tab0 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN col1 * + 19 * + col0 AND + - 16 / + - col2 + col1;
  - name: tab0

outputs:
  - name: q9388.out
    data: |
